import axios from "axios";

export const LoginUser = (data: any) => {
  axios
    .post("https://reqres.in/api/login", data)
    .then((response) => {
      console.log(response);
      if (response.data) {
        alert("Sesion iniciada");
      } else {
        alert("Usuario no existe");
      }
    })
    .catch((error) => {
      if (error) {
        alert("Usuario no existe");
      }
    });
};
